import React, { Component } from 'react';
import '../../styles/css/main.css';
import { Link } from 'react-router-dom'
export default class Header extends Component {
    render() {
        return (
            <div>


                <header className="app-header"><a className="app-header__logo" href="index.html">Itsol</a>
                    {/* Sidebar toggle button*/}
                    <Link className="app-sidebar__toggle" to="" data-toggle="sidebar" aria-label="Hide Sidebar" />
                    {/* Navbar Right Menu*/}
                    <ul className="app-nav">
                        <li className="app-search">
                            <input className="app-search__input" type="search" placeholder="Search" />
                            <button className="app-search__button"><i className="fa fa-search" /></button>
                        </li>
                       
                        {/* User Menu*/}
                        <li className="dropdown">
                        <a className="app-nav__item" href="#" data-toggle="dropdown" aria-label="Open Profile Menu">
                        <i className="fa fa-user fa-lg" /></a></li>
                         
                    </ul>
                </header>

            </div>
        )
    }
}
